{"url": "https://www.americanas.com.br/produto/1232228928", "title": "M\u00e1quina de Recorte Silhouette Cameo 4 Branca - 4t Display Touchscreen - Bivolt", "category": "Artesanato", "price": 2399.0, "description": "A m\u00e1quina de corte mais forte, mais r\u00e1pida e mais inteligente!  Leve suas cria\u00e7\u00f5es para uma nova era com a nova Silhouette Cameo 4: Uma m\u00e1quina de corte dom\u00e9stica que permite fazer cortes precisos em centenas de materiais, como vinil adesivo, cartolina, tecido, EVA e muito mais. Mais do que uma ferramenta de corte, ela \u00e9 como uma m\u00e1quina industrial. Al\u00e9m de cortar, a Cameo 4 tamb\u00e9m \u00e9 capaz de esbo\u00e7ar, estilizar e gravar em v\u00e1rios tipos de materiais, inclusive os mais grossos... e isso n\u00e3o \u00e9 nem o come\u00e7o!  A Cameo 4 possui for\u00e7a de corte de at\u00e9 5kg, contra apenas 250g da Silhouette Cameo 3. Isso permite que ela corte materiais mais grossos, tais como o couro, matboard, madeira de balsa, entre outros. Sua velocidade de corte, em linha reta, \u00e9 3 vezes mais r\u00e1pida do que a da Cameo 3. E sua acelera\u00e7\u00e3o (velocidade na qual a m\u00e1quina pode cortar quando a l\u00e2mina tem que virar ou mudar de dire\u00e7\u00e3o) \u00e9 2x maior em rela\u00e7\u00e3o \u00e0 da Cameo 3.  A Cameo 4 vem com fun\u00e7\u00e3o exclusiva de detec\u00e7\u00e3o autom\u00e1tica de ferramentas, que permite que ela detecte e se ajuste automaticamente a qualquer ferramenta que voc\u00ea conectar no carro (l\u00e2mina, caneta, etc), sem precisar alterar as configura\u00e7\u00f5es no Silhouette Studio. Ela tamb\u00e9m pode cortar sem base de corte. Mas, esta op\u00e7\u00e3o \u00e9 v\u00e1lida apenas para os materiais com poucos detalhes. A Cameo 4 deixa um ponto de liga\u00e7\u00e3o para que o corte fique preso \u00e0 folha e, depois, voc\u00ea precisar\u00e1 apenas destacar!  Esta nova m\u00e1quina de corte da Silhouette possui v\u00e1rios novos acess\u00f3rios, que ser\u00e3o vendidos separadamente em breve. Este \u00e9 o caso da nova L\u00e2mina Kraft, para corte de materiais espessos, como couro e madeira de balsa, e da nova L\u00e2mina Rotativa, para corte de feltros e tecidos. Ambas entregam um corte r\u00e1pido e perfeito.  Com a L\u00e2mina Rotativa Silhouette, a Cameo 4 corta tecidos e feltros sem a necessidade do Adesivo de Precis\u00e3o de Corte. \u00c9 mais liberdade e praticidade para o seu dia a dia de trabalho com artesanato personalizado!  Os recursos da Silhouette Cameo 4 incluem: Nova L\u00e2mina Auto Ajust\u00e1vel de alta velocidade; Suporte de Rolos (Roll Feeder) embutido e retr\u00e1til, que permitir\u00e1 carregar e cortar facilmente materiais em rolo; Ferramenta de Depila\u00e7\u00e3o Autom\u00e1tica, que faz o ponto em cada parte a ser depilada no adesivo, onde o gancho se encaixa; L\u00e2mina de Corte Transversal embutida, que permite cortar vinil ou transfers diretamente do rolo; Folga de 3mm para materiais mais espessos; Tampa Retr\u00e1til e Painel de Toque sem Tela, que proporcionam design moderno e sofisticado ao seu equipamento; Conectividade Bluetooth\u00ae, que possibilita a conex\u00e3o ao Silhouette Studio e o uso da Cameo 4 sem a necessidade de fio; Capacidade de registro de impress\u00e3o e corte (Print &amp; Cut); Compat\u00edvel com a tecnologia PixScan\u2122; Operacionalizada por meio do software Silhouette Studio (gratuito), que oferece diversas configura\u00e7\u00f5es de corte e o uso de op\u00e7\u00f5es ilimitadas de design para personalizar ainda mais os seus projetos; Compat\u00edvel com sistemas operacionais Mac e Windows.  O que acompanha sua Silhouette Cameo 4: Silhouette CAMEO\u00ae 4 com Conectividade Bluetooth\u00ae; Fonte de alimenta\u00e7\u00e3o e cabo USB; Base de Corte para Silhouette Cameo 30x30 cm; L\u00e2mina de Corte Auto Ajust\u00e1vel de Alta Velocidade Silhouette; 04 Adaptadores distintos para usar ferramentas das vers\u00f5es anteriores da Cameo; Software Silhouette Studio\u00ae (download); 100 designs exclusivos (download);    "}
